import styled from 'styled-components';

export const Box2= styled.div`
    padding-top: 80px;
    width: 100%;
    text-align: center;
    
`;

export const Frame= styled.iframe`
    width: 80%;
    height: 400px;
    loading: lazy;
    z-index: -9;
    margin: 20px;
`;
